mapper.select:

select 

from groupon_team
where groupon_id = #{grouponId,jdbcType=VARCHAR}
  and user_id = #{userId,jdbcType=VARCHAR}

mapper.update:

update groupon_team


    captain = #{captain,jdbcType=SMALLINT},


    create_date = #{createDate,jdbcType=TIMESTAMP},


    update_date = #{updateDate,jdbcType=TIMESTAMP},


where groupon_id = #{grouponId,jdbcType=VARCHAR}
  and user_id = #{userId,jdbcType=VARCHAR}

mapper.delete:

delete from groupon_team
where groupon_id = #{grouponId,jdbcType=VARCHAR}
  and user_id = #{userId,jdbcType=VARCHAR}

mapper.select:
select 

from groupon_team where 1 = 1 

    and captain = #{captain,jdbcType=SMALLINT}


    and create_date = #{createDate,jdbcType=TIMESTAMP}


    and update_date = #{updateDate,jdbcType=TIMESTAMP}

mapper.delete:

delete from groupon_team


      and captain = #{captain,jdbcType=SMALLINT}


      and create_date = #{createDate,jdbcType=TIMESTAMP}


      and update_date = #{updateDate,jdbcType=TIMESTAMP}

